$(document).ready(function(){$(".navbar a, footer a[href='#agency_page']").on("click",function(o){if(""!==this.hash){o.preventDefault();var a=this.hash;$("html, body").animate({scrollTop:$(a).offset().top},900,function(){window.location.hash=a})}});var a=$("nav").offset().top;$(window).scroll(function(){var o=$(window).scrollTop();a<o?$("nav").addClass("fixed-top"):$("nav").removeClass("fixed-top")})});